--
-- Name: buildings; Type: TABLE; Schema: app; Owner: postgres; Tablespace: 
--

CREATE TABLE buildings (
    gid integer NOT NULL,
    objectid double precision,
    objorig character varying(20),
    dateofchng date,
    uuid character varying(40),
    objorig_ye character varying(20),
    objval character varying(50),
    the_geom public.geometry,
    CONSTRAINT enforce_dims_the_geom CHECK ((public.st_ndims(the_geom) = 2)),
    CONSTRAINT enforce_geotype_the_geom CHECK (((public.geometrytype(the_geom) = 'MULTIPOLYGON'::text) OR (the_geom IS NULL))),
    CONSTRAINT enforce_srid_the_geom CHECK ((public.st_srid(the_geom) = 21781))
);


ALTER TABLE app.buildings OWNER TO postgres;

--
-- Name: buildings_gid_seq; Type: SEQUENCE; Schema: app; Owner: postgres
--

CREATE SEQUENCE buildings_gid_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


